/**
 * Helper function to look up an Arweave transaction ID from a filename
 * @param filename The original filename from S3
 * @param type The type of file (model or thumbnail)
 * @returns The Arweave transaction ID if found, or undefined
 */
export function getArweaveTxId(filename: string, type: 'model' | 'thumbnail'): string | undefined {
  const mapping = type === 'model' ? avatarModelMapping : avatarThumbnailMapping;
  
  // Extract just the filename if the input contains a path
  const bareFilename = filename.split('/').pop() || filename;
  
  return mapping[bareFilename];
}

export default {
  avatarModelMapping,
  avatarThumbnailMapping,
  getArweaveTxId
};